from Crypto.Util.number import *

def to_ascii(x):
    """
        int --> hex --> ascii
    """
    x_hex = hex(int(x))[2:-1]
    x_hex_len = len(x_hex)
    x_ascii = "".join(chr(int(x_hex[i : i + 2], 16)) for i in range(0, x_hex_len, 2))
    return x_ascii.strip()

